Forty immaculate flowers on 14 up to 30-cm inflorescences, well spaced around plant;
108-cm x 50-cm plant, 30-cm plastic pot, bark;
sepals and petals pink-lavender;  
lip heavily ruffled, pink-lavender overlaid dark magenta distally, bright yellow centrally, side lobes cream;


column cream, anther cap white;
substance firm; texture matte.
